(40, 'default13223000761', '', '', '', '', '', '', 'admin', 'Tinh chất đặc trị vùng da bị thâm, nám, làm trắng sáng da', '&lt;p&gt;\r\n	Serum Lancome Blanc Expert GN White Agefight trị n&amp;aacute;m, t&amp;agrave;n nhang phi&amp;ecirc;n bản mới nhất t&amp;iacute;ch hợp với việc điều trị n&amp;aacute;m, t&amp;agrave;n nhang với chống l&amp;atilde;o h&amp;oacute;a da 2 in 1. Gi&amp;uacute;p đ&amp;aacute;nh bật lại c&amp;aacute;c vết n&amp;aacute;m bằng c&amp;aacute;ch cải thiện s&amp;acirc;u v&amp;agrave;o từng tế b&amp;agrave;o da, ti&amp;ecirc;u diệt v&amp;agrave; ngăn ngừa việc sản sinh sắc tố melanin từ b&amp;ecirc;n trong gi&amp;uacute;p da đều m&amp;agrave;u hơn, s&amp;aacute;ng hơn kết hợp với việc trừ nhăn, chống l&amp;atilde;o h&amp;oacute;a. C&amp;aacute;ch d&amp;ugrave;ng: L&amp;agrave;m sạch mặt v&amp;agrave; b&amp;ocirc;i l&amp;ecirc;n v&amp;ugrave;ng n&amp;aacute;m, sạm hoặc b&amp;ocirc;i cả mặt, sau đ&amp;oacute; c&amp;oacute; thể b&amp;ocirc;i kem dưỡng c&amp;ugrave;ng d&amp;ograve;ng, chống nắng t&amp;ugrave;y nhu cầu. Ng&amp;agrave;y 2 lần s&amp;aacute;ng v&amp;agrave; tối.&lt;/p&gt;', '&lt;p&gt;\r\n	Chế độ dưỡng trắng da v&amp;agrave; ngăn chăn l&amp;atilde;o ho&amp;aacute; với Tinh chất Blanc Expert GN-White Agefight:&lt;br /&gt;\r\n	1.&amp;nbsp;&amp;nbsp;&amp;nbsp; Sữa rửa mặt tạo bọt v&amp;agrave; dưỡng trắng da&lt;br /&gt;\r\n	2.&amp;nbsp;&amp;nbsp;&amp;nbsp; Nước lotion l&amp;agrave;m mềm v&amp;agrave; dưỡng trắng da (nước hoa hồng)&lt;br /&gt;\r\n	3.&amp;nbsp;&amp;nbsp;&amp;nbsp; Tinh chất Blanc Expert GN-White Agefight&lt;br /&gt;\r\n	4.&amp;nbsp;&amp;nbsp;&amp;nbsp; Kem dưỡng ẩm l&amp;agrave;m trắng da hoặc kem dưỡng ẩm v&amp;agrave; t&amp;aacute;i tạo ban đ&amp;ecirc;m&lt;br /&gt;\r\n	5.&amp;nbsp;&amp;nbsp;&amp;nbsp; Buổi s&amp;aacute;ng d&amp;ugrave;ng th&amp;ecirc;m kem chống nắng UV Expert SPF 50&lt;br /&gt;\r\n	C&amp;oacute; thể sử dụng tinh chất trẻ ho&amp;aacute; gene Genefique trước khi sử dụng tinh chất Blanc Expert GN-White Agefight để tăng cường hiệu quả chống l&amp;atilde;o ho&amp;aacute; v&amp;agrave; t&amp;aacute;i tạo l&amp;agrave;n da đầy sức sống v&amp;agrave; rạng ngời.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Link tham khảo: http://vn.strawberrynet.com/skincare/lancome/blanc-expert-gn-white-agefight/104634/&lt;/p&gt;', 'tinh-chat-dac-tri-vung-da-bi-tham-nam-lam-trang-sang-da', '', '', '', '', 0, 0, 20, 'upload/1413_P_13175591268711.jpg', 0, '', '[][Lancome]', 0, 0, 'active', '', '2011-11-26 16:34:36', '', '2012-08-10 19:33:27'),
