(160, 'default13457337521', '', '', '', '', 'module/product', '[duongdavungmat]', 'admin', 'Absolue Yeux Precious Cells Kem dưỡng mắt trị lão hóa &amp; tái tạo tế bào gốc', '&lt;p&gt;\r\n	C&amp;ocirc;ng thức c&amp;oacute; chức năng giảm bọng mắt, l&amp;agrave;m r&amp;otilde; v&amp;ugrave;ng m&amp;iacute; mắt v&amp;agrave; đem lại n&amp;eacute;t rạng ngời cho đ&amp;ocirc;i mắt. &amp;nbsp;Kết cấu tinh tế, mềm mượt gi&amp;uacute;p v&amp;ugrave;ng da nhạy cảm n&amp;agrave;y săn chắc v&amp;agrave; trẻ h&amp;oacute;a. H&amp;agrave;ng ch&amp;iacute;nh h&amp;atilde;ng.&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Xuất xứ: &amp;nbsp;Made in France&lt;/p&gt;', '', 'absolue-yeux-precious-cells-kem-duong-mat-tri-lao-hoa--tai-tao-te-bao-goc', '', '', '', '', 0, 0, 108, 'upload/aaa.png', 0, '', '[][Lancome]', 0, 0, 'active', '', '2012-08-23 21:55:52', '', '2013-04-11 11:37:40'),
