(162, 'default13467451701', '', '', '', '', 'module/product', '[kemduongda]', 'admin', 'Clinique Moisture Surge Dưỡng Ẩm Tràn Đầy Sức Sống', '&lt;p&gt;\r\n	L&amp;agrave; sản phẩm dưỡng ẩm của Clinique, bạn c&amp;oacute; thể d&amp;ugrave;ng như 1 loại kem l&amp;oacute;t trước khi trang điểm, bảo vệ tốt cho da mặt, chống nắng.&lt;br /&gt;\r\n	Nhẹ nh&amp;agrave;ng, thoải m&amp;aacute;i giữ ẩm cho da trong cả 24 giờ. Những nếp nhăn cực nhỏ, sự kh&amp;ocirc; da hay bong tr&amp;oacute;c kh&amp;ocirc;ng c&amp;ograve;n nữa. Thay v&amp;agrave;o đ&amp;oacute; l&amp;agrave; một l&amp;agrave;n da dẻo dai, đầy sức sống v&amp;agrave; tươi trẻ.&lt;br /&gt;\r\n	&lt;strong&gt;C&amp;aacute;ch sử dụng:&lt;/strong&gt;&lt;br /&gt;\r\n	Sử dụng h&amp;agrave;ng ng&amp;agrave;y khi muốn tăng cường độ ẩm cho da ngay lập tức. Để tăng cường v&amp;agrave;o giữa ng&amp;agrave;y, dậm ngay tr&amp;ecirc;n lớp trang điểm sẵn c&amp;oacute;. Hoặc sử dụng như 1 mặt nạ dưỡng ẩm trong v&amp;ograve;ng 5 ph&amp;uacute;t: massage l&amp;ecirc;n da mặt đ&amp;atilde; được l&amp;agrave;m sạch, d&amp;ugrave;ng khăn giấy thấm bớt lượng kem dư.&lt;br /&gt;\r\n	&lt;strong&gt;Trọng lượng:&lt;/strong&gt;&lt;br /&gt;\r\n	Dung t&amp;iacute;ch 30ml. Dạng tube.&lt;br /&gt;\r\n	&lt;strong&gt;Xuất xứ:&lt;/strong&gt;&lt;br /&gt;\r\n	Made in USA.&lt;/p&gt;', '', 'clinique-moisture-surge-duong-am-tran-Đay-suc-song', '', '', '', '', 0, 0, 109, 'upload/12555680401.jpg', 0, '', '[][Clinique]', 0, 0, 'active', '', '2012-09-04 14:52:50', '', '2013-03-10 15:31:03'),
