(164, 'default13467473361', '', '', '', '', 'module/product', '[kemduongda]', 'admin', 'Clinique Dưỡng ẩm (step3) dành cho da khô hoặc hỗn hợp, khô', '&lt;p&gt;\r\n	&lt;strong&gt;M&amp;ocirc; tả sản phẩm:&lt;/strong&gt;&lt;br /&gt;\r\n	Dưỡng ẩm Clinique d&amp;agrave;nh cho da kh&amp;ocirc; hay hỗn hợp thi&amp;ecirc;n kh&amp;ocirc; Clinique Dramatically Different Moisturizing Lotion: Khi bạn nhận thấy da kh&amp;ocirc;, dễ bong tr&amp;oacute;c v&amp;agrave; xỉn m&amp;agrave;u th&amp;igrave; đ&amp;acirc;y l&amp;agrave; sản phẩm d&amp;agrave;nh cho bạn. L&amp;agrave;n da của bạn sẽ được duy tr&amp;igrave; đủ độ ẩm, da s&amp;aacute;ng khỏe, mịn m&amp;agrave;ng.&lt;br /&gt;\r\n	&lt;strong&gt;C&amp;aacute;ch sử dụng:&lt;/strong&gt;&lt;br /&gt;\r\n	D&amp;ugrave;ng sau khi l&amp;agrave;m sạch mặt, ph&amp;ugrave; hợp cho da kh&amp;ocirc; hoặc hỗn hợp thi&amp;ecirc;n kh&amp;ocirc;.&lt;br /&gt;\r\n	&lt;strong&gt;Trọng lượng:&lt;/strong&gt;&lt;br /&gt;\r\n	Dung t&amp;iacute;ch 30ml.&lt;br /&gt;\r\n	&lt;strong&gt;Xuất xứ:&lt;/strong&gt;&lt;br /&gt;\r\n	Made in USA.&lt;/p&gt;', '', 'clinique-duong-am-step3-danh-cho-da-kho-hoac-hon-hop-kho', '', '', '', '', 0, 0, 110, 'upload/V159471806_.jpg', 0, '', '[][Clinique]', 0, 0, 'active', '', '2012-09-04 15:28:56', '', '2013-03-10 15:21:12'),
